def generate_test_case():
    final_string = ""
    black_figs = 3 * "r" + 5 * "p" + 2 * "b" + 1 * "q" + 2 * "n"
    white_figs = black_figs.upper()

    possible_figs = white_figs + black_figs
    w_king_position = random.randint(0, 7), random.randint(0, 7)
    b_king_position = random.randint(0, 7), random.randint(0, 7)

    if w_king_position[0] == b_king_position[0] + 1 or w_king_position[0] == b_king_position[0] - 1 or \
            w_king_position[1] == b_king_position[1] + 1 or w_king_position[1] == b_king_position[1] - 1:
        return generate_test_case()

    w_king_placed = False
    b_king_placed = False
    for i in range(8):
        already_passed = 0
        while already_passed < 8:
            if i == w_king_position[0] and already_passed >= w_king_position[1] and w_king_placed is False:
                final_string += "K"
                w_king_placed = True
                already_passed += 1
                continue

            if i == b_king_position[0] and already_passed >= b_king_position[1] and b_king_placed is False:
                final_string += "k"
                b_king_placed = True
                already_passed += 1
                continue

            nums = "".join(str(_) for _ in range(1, 7 - already_passed + 1)) * 3

            if len(final_string) > 1:
                if final_string[-1].isdigit():
                    the_list = possible_figs

                else:
                    the_list = possible_figs + nums

            else:
                the_list = possible_figs

            new_fig = random.choice(the_list)
            if new_fig == "k":
                possible_figs = possible_figs.replace("k", "")
            if new_fig == "K":
                possible_figs = possible_figs.replace("K", "")

            if new_fig.lower() == "p" and i in [0, 7]:
                continue

            final_string += new_fig

            try:
                already_passed += int(new_fig)
            except ValueError:
                already_passed += 1

        final_string += "/"

    for _ in range(random.randint(0, 3)):
        final_string += random.choice(white_figs)

    for _ in range(random.randint(0, 3)):
        final_string += random.choice(black_figs)
    return final_string + (" w" if random.randint(0, 1) else " b")


