def make_program_to_string(args, cases):
    return [outToString(subprocess.check_output(args + [item])) for item in cases]


def isSubsetStringOf(a, b):
    """Assumed to be in form "[a1-a2,...]" """

    asp = a.split(",")
    bsp = b.split(",")

    return all(a in bsp for a in asp)


def containsDuplicates(a):
    return len(a.split(",")) != len(set(a.split(",")))


def check_equal(a, b, a_name="a", b_name="b", debug_level=0):
    """debug_level: 0 for no out, 1 for string for False, 2 for entire"""
    will_be_fine = isSubsetStringOf(a, b) and isSubsetStringOf(b, a) and not containsDuplicates(a) and not containsDuplicates(b)

    if debug_level == 0:
        return will_be_fine

    if debug_level == 2 and containsDuplicates(a):
        dup = [item for item in a.split(",") if a.split(",").count(item) > 1]
        print(f"{a_name} string contains duplicates!\n{a}\n{dup}\n\nThis in not allowed!\n")

    if debug_level == 2 and containsDuplicates(b):
        dup = [item for item in a.split(",") if a.split(",").count(item) > 1]
        print(f"{b_name} string contains duplicates!\n{a}\n{dup}\n\nThis in not allowed!\n")

    if debug_level == 2 and isSubsetStringOf(a, b):
        print(f"{a_name}\t⊆\t{b_name}")

    if debug_level == 2 and isSubsetStringOf(b, a):
        print(f"{b_name}\t⊆\t{a_name}")

    if debug_level == 2 and isSubsetStringOf(a, b) and isSubsetStringOf(b, a):
        print()
        print(f"Both {a_name} ⊆ {b_name} and {b_name} ⊆ {a_name} are True. Therefore {a_name} = {b_name}")

    else:
        if debug_level == 2 and not isSubsetStringOf(b, a):
            print(f"{a_name} string did not contain all items of {b_name}.")
            print(f"{a_name} missing items:")
            print(list(set(b.split(",")).difference(a.split(","))))

        if debug_level == 2 and not isSubsetStringOf(a, b):
            print(f"{b_name} string did not contain all items of {a_name}.")
            print(f"{b_name} missing items:")
            print(list(set(a.split(",")).difference(b.split(","))))

        if debug_level > 0 and not will_be_fine:
            print()
            print(f"{a_name}:\t{a}")
            print(f"{b_name}:\t{b}")

    return will_be_fine


class ExecutableFile:
    def __init__(self, file_path, is_haskell, name="", pck="de.tuberlin.sese.swtpp.gameserver.model.crazyhouse.CrazyhouseGame"):
        self.file_path = file_path
        self.is_haskell = is_haskell
        self.name = name

        self.pck = pck


def test_exe(exe, test_cases, num_processes, debug_time=False):
    s = time()

    if exe.is_haskell is None:
        args = [(["java", "-jar", exe.file_path], case) for case in test_cases]
    elif exe.is_haskell:
        args = [([exe.file_path], case) for case in test_cases]
    else:
        args = [(["java", "-cp", exe.file_path, exe.pck], case) for case in test_cases]

    with mp.Pool(num_processes) as p:
        answers = p.starmap(make_program_to_string, args)

    e = time()

    if debug_time:
        print(f"Finished {exe.name} in {e - s:.5f}")
    return answers


